import Vue from 'vue';   
export default Vue.extend({    
    name: 'abFooter',
     data: () => ({
     icons: [
    'fab fa-facebook',
    'fab fa-twitter',
    'fab fa-google-plus',
    'fab fa-linkedin',
    'fab fa-instagram'
  ],
    support: [
      'Guides',
      'FAQ',
      'Announcements',
      'Terms of Service',
      'Transaction Regulations',
      'Fees',
      'Terms of Privacy Policy',
      'KYC&AML Policies',
      // &amp; => &;
      'Support@allb.com'
    ]
})    
});
